(31, '8', '0000000008', '24', '105', 'PUTRAJAYA: The defences brouhaha that two SRC International Sdn Bhd directors had used forged or cut and paste signatures to remit RM42 million which finally ended up in Najib Razaks private bank accounts is not an issue in the trial, the Court of Appeal heard today.\r\n\r\nAd hoc prosecutor V Sithambaram said if at all there was a dispute, it was between SRC and the bank, and not Najib, who was not a party to the alleged wrongdoing.\r\n\r\nThey (defence) are merely busybodies. Najib has no privity of contract with the bank, he said.\r\n\r\nSithambaram, who was given a special licence by the attorney-general to prosecute Najibs SRC International corruption case, said the defence has to respond to the prosecutions case on the seven charges faced by the former prime minister.\r\n\r\nThe issue of forged or unauthorised scan (of signatures) and electronic transfer is a non-starter, especially for the criminal breach of trust charges.', '1', 'A003', 'Test2', 'PUNB', 'jigsnoob@gmail.com', '0', NULL, '2021-04-20 05:32:15', '2021-04-20 05:32:15', 'Test2'),
