('3', '24', 31, 'PUNB', 'Muhamad Hanis Firdaus', 'PETALING JAYA: Dr Mahathir Mohamad, who was included in a list of the worlds top 20 most dangerous extremists, said today he was being vilified for his thoughts while others got away with acts of terrorism and violence.\r\n\r\nDr Mahathir was responding to his inclusion last week on a list put up by the US-based Counter Extremism Project website which said he supports extremist violence against the West and has criticised lesbian, gay, bisexual and transgender communities and Jewish people.\r\n\r\nThe website regurgitates half of what I wrote and twisted it so as to imply that I advocate terrorism. I specifically stressed that Muslims are not revengeful, he said in an article on his blog today.\r\n\r\nSo, one can be an extremist for criticising the West, saying things they do not like to hear, even if its the truth. You dont have to do anything. It seems that I am vilified for my thoughts while others get away with acts of terror and violence resulting in death and destruction of the weak and the oppressed.\r\n\r\nThe list includes leaders or members of Hezbollah, Hamas, Islamic State, Muslim Brotherhood, Al Qaeda, as well as the head of a Nazi movement, a white supremacist movement, and an anti-Muslim group in Myanmar.\r\n\r\nMahathir said outgoing US president Donald Trump should be labelled an extremist for the storming of the US Capitol by his supporters, which has been largely attributed to his incitement.', '02 January 2021', NULL, '2021-01-11 22:59:21', 'Active', 'Closed', '2021-01-11 15:03:42', '2021-04-13 03:51:29', 'Muhamad Hanis Firdaus'),
