('8', '24', 97, 'PUNB', 'Muhamad Hanis Firdaus', 'Kuala Lumpur: Sebaik memasuki ruangan Jabatan Kecemasan Hospital Kuala Lumpur (HKL), beliau melihat tiga mangsa terbaring di atas katil sorong selain suasana di situ cemas.\r\n\r\nMatanya terarah kepada sekujur tubuh yang sebahagian perutnya terbuka dan mangsa mengerang kesakitan. Di sebelahnya, pemandangan lebih mengerikan.\r\n\r\nMuka terbelah dan menampakkan tulang rahang hingga ke leher manakala seorang lagi sedang bergelut dengan maut dan cuba diselamatkan oleh doktor.\r\n\r\nItu visual ngeri yang menjadi petunjuk awal bekas wartawan Harian Metro (HM), Wan Sabariah Shikh Ali menulis berita Tragedi Letupan Kilang Mercun Bright Sparklers, Sungai Buloh, 30 tahun lalu.\r\n\r\nWan Sabariah berkata, pada petang 7 Mei 1991, beliau sedang mewawancara Pengarah Hospital Kuala Lumpur (HKL) ketika itu, Datuk Dr Megat Burhanuddin Abdul Rahman di pejabatnya di tingkat satu bangunan utama HKL.\r\n\r\n\"Kira-kira jam 5.30 petang, beliau menerima panggilan telefon dan berkata kepada saya: \'Wan Sab, mari ikut saya ke Jabatan Kecemasan, ada kes letupan besar, mangsa pertama baru tiba.\'\r\n\r\n\"Gambaran di atas itu adalah petunjuk pertama. Beberapa ketika selepas itu, beberapa kes lagi tiba.\r\n\r\n\"Suasana di Jabatan Kecemasan HKL hiruk-pikuk, pegawai perubatan cuba menyelamatkan mereka dalam keadaan kritikal.\r\n\r\n\"Saya melihat seorang lelaki, seluruh tubuhnya menjadi kuning, tiada kecederaan fizikal pada beliau,\" katanya.\r\n\r\nMenurutnya, ketika itu tidak ada maklumat lengkap mengenai kejadian sebenar.\r\n\r\n\"Ada yang mengatakan letupan kilang peluru di Sungai Buloh, ada juga mengatakan kilang gelas.\r\n\r\n\"Apabila saya melangkah keluar dari ruang kecemasan, saya jadi pilu. Seorang wanita berusia 50-an meraung dan akhirnya memeluk saya bertanyakan keadaan suaminya di dalam.\r\n\r\n\"Itu adalah wawancara pertama dengan keluarga mangsa sambil saya cuba menenangkannya.\r\n\r\n\"Tiga ahli keluarganya terbabit  suami, anak lelaki dan menantu. Nasib mereka tidak diketahui. Apabila ditanya apakah yang berlaku, barulah saya tahu bahawa kilang mercun meletup,\" katanya.\r\n\r\nBeliau berkata, dari saat itu, wartawan meja berita Harian Metro tidak tidur malam sehinggalah kes terbabit selesai.', '30 April 2021', '30 April 2021', '2021-04-08 16:51:49', 'Active', 'Closed', '2021-04-08 08:52:48', '2021-04-13 06:04:26', 'Muhamad Hanis Firdaus'),
