('8', '24', 102, 'PUNB', 'Muhamad Hanis Firdaus', 'KUALA LUMPUR, 13 April  Sungai Pelek assemblyman Ronnie Liu was insulting DAP with his inference that it must out-Chinese the rival MCA, Damansara MP Tony Pua said.\r\n\r\nResponding to reports of Liu saying DAP should not sacrifice its Chinese identity and culture to fend off political rivals attacks, Pua argued that his party colleague was short sighted as such a strategy would leave it politically dependent on a Malay patron party.\r\n\r\nFrankly speaking, that is perhaps the biggest insult one can throw at the DAP today. MCA has Chineseness themselves into oblivion today. They are completely at the mercy of the whims and fancies of the big-brothers, Umno, Bersatu and PAS who provide MCA with political life-support.', '30 April 2021', NULL, '2021-04-13 12:22:01', 'Active', 'Closed', '2021-04-13 04:22:32', '2021-04-13 04:22:32', 'Muhamad Hanis Firdaus'),
